import classes from "./ContentQuote.module.css"
import Card from "./card";

const ContentQuote=(props)=>{
  return (
    <Card >
        <p className={classes.quote}>As per a report by the World Food Organization, each seventh individual rests hungry. We can halt waste if, at that point, many individuals can be taken care.

India is positioned 67 in the World Hunger Index. The nation produces 251 million tons of food grains each year, yet every fourth Indian sleep hungry. </p>
    </Card>
  )
}

export default ContentQuote;
